@xuchuanyin What I have mentioned is that instead of adding the mapping in datamap, handle while writing the datamap. 
Currently the blocklet number is respective to each block while writing the datamap , instead generate blocklet number respective to complete index file.
In this approach, we can eliminate the block to bloclet mapping completely even inside datamaps.

@jackylk review comments are fixed. Add a dm_property called ‘bloom_size’ to configure the size of bloom filter.

Since we can have multiple indexed columns and the cardinality of them differs, so we can support specifying corresponding bloom_size in the future.

Besides, more tests are needed, such as exception, datamap profiling for this datamap -- will do it in the future, this version will only provide the basic correct test case for example.
